const LoaderAnimationWrapper = styled.div`
  height: 100vh;
  .animation {
    position: absolute;
    top: 45%;
    bottom: 80%;
    left: 0;
    right: 0;
    margin: 0 auto;
    width: fit-content;
    transform: translate(-50%; -50%);
  }

  #sckilled path {
    stroke-dasharray: 449px;
    stroke-dashoffset: 449px;
    animation: animateText 2s ease forwards 0.5s;
  }

  #sckilled2 path {
    stroke-dasharray: 565;
    stroke-dashoffset: 565px;
    animation: animateText 2s ease forwards 0.9s;
  }

  #sckilled3 path {
    stroke-dasharray: 449px;
    stroke-dashoffset: 449px;
    animation: animateText 2s ease forwards 1.6s;
  }

  #sckilled4 path {
    stroke-dasharray: 449px;
    stroke-dashoffset: 449px;
    animation: animateText 2s ease forwards 2.2s;
  }

  #sckilled5 path {
    stroke-dasharray: 227px;
    stroke-dashoffset: 227px;
    animation: animateText 2s ease forwards 2.8s;
  }

  #sckilled6 path {
    stroke-dasharray: 605px;
    stroke-dashoffset: 605px;
    animation: animateText 2s ease forwards 3.4s;
  }

  #sckilled7 path {
    stroke-dasharray: 494px;
    stroke-dashoffset: 494px;
    animation: animateText 2s ease forwards 3.9s;
  }

  #sckilled8 path {
    stroke-dasharray: 494px;
    stroke-dashoffset: 494px;
    animation: animateText 2s ease forwards 4.4s;
  }
  .animation {
    animation: topUp 2s ease forwards 4.7s;
  }
  .sc-ani {
    animation: topUp2 2s ease forwards 4.7s;
  }

  @keyframes animateText {
    from {
      opacity: 0;
      fill: transparent;
    }
    to {
      fill: #2868c5;
      stroke-dashoffset: 0;
      opacity: 0.9;
    }
  }
  @keyframes topUp {
    0% {
      top: 45%;
    }
    50% {
      opacity: 1;
    }
    100% {
      top: -4%;
      opacity: 0;
    }
  }
  @keyframes topUp2 {
    0% {
      width: 100px;
    }
    70% {
      opacity: 0.7;
    }
    100% {
      width: 20px;
      opacity: 0;
    }
  }
  @media only screen and (max-width: 580px) {
    svg {
      width: 40px;
    }
    #sckilled2, #sckilled7{
      width: 40px;
      height: 90px;
    }
    .animation {
      animation: topUp 4s ease forwards 4.7s;
    }
    .sc-ani {
      animation: topUpmobile 4s ease forwards 4.7s;
    }
    @keyframes topUp {
      0% {
        top: 45%;
      }
      50% {
        opacity: 1;
      }
      100% {
        top: -5%;
        opacity: 0;
      }
    }
    @keyframes topUpmobile {
      0% {
        width: 40px;
      }
      70% {
        opacity: 0.7;
      }
      100% {
        width: 19px;
        opacity: 0;
      }
    }
  }
`;

